// import { useState } from "react";
import Card from "./Card";
import uniqid from "uniqid";

function Shop(props) {
  const { cartItems, setCartItems } = props;
  const cards = [
    { id: uniqid(), title: "Apple", imageUrl: "https://www.applesfromny.com/wp-content/uploads/2020/06/SnapdragonNEW.png" },
    { id: uniqid(), title: "Pear", imageUrl: "https://www.fourwindsgrowers.com/products/danjou-pear-tree" },
    { id: uniqid(), title: "Strawberry", imageUrl: "https://www.thermofisher.com/blog/food/what-rot-strawberry-proteomics-and-the-art-of-staying-fresh/" },
    { id: uniqid(), title: "Watermelon", imageUrl: "https://i5.walmartimages.com/asr/14487aaf-d86a-4b46-acaf-7621b90286bb.fb737768267fcdc95c33f355b730ad15.jpeg" },
    { id: uniqid(), title: "Peach", imageUrl: "https://glycemic-index.net/images/FVRSYndNy8.webp" },
    { id: uniqid(), title: "Grapes", imageUrl: "https://static.libertyprim.com/files/varietes/red-globe-large.jpg?1588355080" },
    { id: uniqid(), title: "", imageUrl: "" },
    { id: uniqid(), title: "", imageUrl: "" },
  ];
  // const [cards, setCards] = useState([
  //   { id: uniqid() },
  //   { id: uniqid() },
  //   { id: uniqid() },
  // ]);
  return (
    <div className="div-shop">
      {cards.map((card) => (
        <Card key={card.id} setCartItems={setCartItems} cartItems={cartItems} title={card.title} />
      ))}
    </div>
  );
}

export default Shop;
